DROP TABLE IF EXISTS `llidc_machines`;
CREATE TABLE `llidc_machines` (
  `m_id` int(9) NOT NULL AUTO_INCREMENT COMMENT '机器ID',
  `m_ip` varchar(255) NOT NULL COMMENT '机器IP',
  `m_idc_location` varchar(255) NOT NULL DEFAULT '' COMMENT '所属IDC机房',
  `m_cabinet_num` varchar(255) NOT NULL COMMENT '机柜号',
  `m_num` varchar(255) DEFAULT '' COMMENT '机柜号-利联',
  `m_num_wy` varchar(255) DEFAULT NULL COMMENT '机柜号-唯一',
  `m_bandwidth` varchar(255) NOT NULL COMMENT '机器带宽',
  `m_status` varchar(255) NOT NULL COMMENT 'machine''s status:vacant,rent,host or trial',
  `m_sales` varchar(255) DEFAULT '' COMMENT '业务员',
  `m_config` varchar(255) NOT NULL COMMENT '机器配置',
  `m_reg_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '机器的录入时间',
  `m_memo` varchar(255) DEFAULT NULL COMMENT '机器备注',
  `m_client` varchar(255) DEFAULT NULL COMMENT '拥有该机器使用权限的客户账号',
  `m_type` varchar(255) DEFAULT '0' COMMENT '0:普通机器,1刀片机',
  `m_bm_mnum` varchar(255) DEFAULT '' COMMENT '刀片机母机编号',
  `m_bm_num` varchar(255) DEFAULT '' COMMENT '刀片机编号 ',
  `m_bm_ip` varchar(255) DEFAULT NULL COMMENT '刀片机内网IP',
  PRIMARY KEY (`m_id`,`m_ip`),
  KEY `machines` (`m_ip`,`m_cabinet_num`,`m_num`,`m_num_wy`) USING BTREE,
  FULLTEXT KEY `cabinet` (`m_idc_location`,`m_sales`) COMMENT '机房名称，录入人名称'
) ENGINE=InnoDB AUTO_INCREMENT=920172875 DEFAULT CHARSET=utf8;

